import "./style.min.css";

export const Input1 = ({ placeholder, value }) => (
  <input
    className="input"
    placeholder={placeholder}
    type="text"
    value={value}
  />
);

export const Input2 = ({ placeholder, value }) => (
  <textarea
    className="input"
    placeholder={placeholder}
    type="text"
    value={value}
  />
);
